    // Your component JSX
  );
};

export default YourComponent;
```

### Explanation:
1. **useRef**: We use `useRef` to store the timestamp of the last time the effect ran.
2. **Date.now()**: We get the current timestamp using `Date.now()`.
3. **Condition**: We check if the difference between the current time and the last run time is greater than or equal to 600 milliseconds (0.6 seconds).
4. **Update Timestamp**: If the condition is met, we update the `lastRun` ref to the current time and execute the code inside the `useEffect`.

